import React from 'react';

import "./navbar.css"; 

import { Link } from "react-router-dom";

const Navbar = () => {
    return (
        <nav>
            <div>
            <span class="material-symbols-outlined home">home</span>
            <input type="text"></input>
            </div>
            <div>
                <Link to="/log-in">Log In</Link>
            </div>
        </nav>
    )
}

export default Navbar;
